import { useSelector } from "react-redux";

function Question() {
    // Get the selected topic from the Redux store
    const selectedTopicId = useSelector(state => state.questionReducer); // Ensure you access the correct state property

    console.log(selectedTopicId);

    return (
        <>
            <h2>Bài Quiz chủ đề: HTML5</h2>
            {
                Array.isArray(selectedTopicId) && selectedTopicId.length > 0 ? (
                    selectedTopicId.map(item => (
                        <ul key={item.id}>{item.question}</ul>
                    ))
                ) : (
                    <>Giỏ hàng trống</> // Fallback message when there's no data
                )
            }
        </>
    );
}

export default Question;
